import React, { Component } from 'react';
import './App.scss';
import Header from './Header';

class App extends Component {
  constructor(props) {
    super(props);
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange = () => {
    console.log('byebye');
  }

  render() {

    return (
      <div className="container">
        <Header />
      </div>
    );
  }
}

export default App;
